Loops allow to run a piece of code for a while. The most common loop is the range loop: for i in 0..10 command ${i}
end This will run command 0 to command 9. To include the upper bound, we must add an = symbol: for i in 0..=10 command ${i}
end This will run command 0 to command 10. We can also iterate on a list: var str = "Jack" var list = [ "Jack", "John" ] for name in list echo ${name}
end This will display Jack and John. To get the indexes as well, we can do: for i, name in list echo "${i}: ${name}"
end This will display 0: Jack and 1: John. There is another type of loop, which runs a piece of code while a condition is met: while # condition command
end If the condition is false when the loop is reached, the command will not be ran once. Else, it will be ran as long as the condition is true. Note that loops can be broke anytime using the break keyword: for i in 0..10 command ${i} if i == 2 break end
end This will run command 0, command 1 and command 2 only.

