Closures are anonymous functions which are generally used to repeat the same group of operations. var test: fn (string, int) = { a, b -> echo "${a.repeat(b)}" }
test("Hello world! ", 3) # Prints: "Hello world! Hello world! Hello world! " Note that closures can also return values implicitly: var test: fn (string, int) -> string = { a, b -> a.repeat(b) }
echo ${test("Hello world!", 3)} # Prints: "Hello world! Hello world! Hello world! " Also, closures are not forced to take their declared parameters: type testType = fn (string, int) var test: testType = { a, b, c -> ### ... ### } # NOT VALID
var test: testType = { a, b -> ### ... ### } # Valid
var test: testType = { a -> ### ... ### } # Valid
var test: testType = { -> ### ... ### } # Valid Here is a concrete usage example: fn forEachFile(dir: path, callback: fn (path)) for item in $(ls ${dir} --details) if item.isFile callback(item.fullPath) end end
end forEachFile(./, { file -> echo "File: ${file}" })

