Display a value to CMDOUT. # echo [-n] { <anystr> | -b <stream>}
#
# "-b": print a stream as UTF-8
# "-n": don't put a newline break at the end of the content echo "Hello world"
echo -n "Hello world!"
echo -b $(streamify "Hello world!")
